import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import anime from 'animejs/lib/anime.es.js';
import Footer from './footer';

const HomePage = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const textWrapperRef = useRef(null);

  useEffect(() => {
    const handleResize = () => {
      setIsMobileView(window.innerWidth <= 1050);
    };

    const animateText = () => {
      if (textWrapperRef.current) {
        textWrapperRef.current.innerHTML = textWrapperRef.current.textContent.replace(/\S/g, "<span class='letter'>$&</span>");
        anime.timeline({ loop: true })
          .add({
            targets: '.ml13 .letter',
            translateY: [100, 0],
            opacity: [0, 1],
            easing: 'easeOutExpo',
            duration: 1400,
            delay: (el, i) => 30 * i,
          })
          .add({
            targets: '.ml13 .letter',
            translateY: [0, -100],
            opacity: [1, 0],
            easing: 'easeInExpo',
            duration: 1200,
            delay: (el, i) => 30 * i,
          });
      }
    };

    handleResize();
    animateText();

    window.addEventListener('resize', handleResize);
    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  return (
    <div style={{ position: 'relative', minHeight: '100vh', overflow: 'hidden', fontFamily: 'Arial, sans-serif' }}>
      {/* Gradient Animated Background */}
      <div className="gradient-bg" style={{ position: 'absolute', top: 0, left: 0, right: 0, bottom: 0, zIndex: -1 }}></div>

      <header style={{ marginTop: '10%', padding: '1rem', textAlign: 'center', color: '#fff' }}>
        <h1 style={{ fontSize: isMobileView ? '30px' : '50px', fontWeight: 'bold' }}>
          Hi, I'm Mohammed <span role="img" aria-label="wave">👋</span>
        </h1>
        <p style={{ fontSize: isMobileView ? '18px' : '24px', maxWidth: '600px', margin: 'auto', lineHeight: '1.6' }}>
          I have been coding and analyzing data for 5+ years. Let's make something awesome together 🤖
        </p>
      </header>

      {/* Rotating Text Animation */}
      <section ref={textWrapperRef} className="ml13" style={{ margin: '3rem 0', textAlign: 'center', color: '#fff' }}>
        Available to work<br />
        <span style={{ fontSize: '16px', color: '#ccc' }}>Flexible salary</span>
      </section>

      {/* Call-to-Action Buttons */}
      <div style={{ display: 'flex', justifyContent: 'center', gap: '20px', marginTop: '2rem' }}>
        <Link
          to="/about"
          className="cta-btn"
          style={{
            background: 'linear-gradient(45deg, #ff8a00, #e52e71)',
            color: '#fff',
            padding: '12px 24px',
            borderRadius: '50px',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: 'bold',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
            transition: 'transform 0.3s, box-shadow 0.3s',
          }}
          onMouseEnter={(e) => (e.target.style.transform = 'scale(1.1)')}
          onMouseLeave={(e) => (e.target.style.transform = 'scale(1)')}
        >
          About Me
        </Link>
        <a
          href="https://react--portfolio.s3.eu-west-2.amazonaws.com/Mohammed+Bakhshi+CV+.pdf"
          download="Mohammed_Bakhshi_CV.pdf"
          target="_blank"
          rel="noopener noreferrer"
          className="cta-btn"
          style={{
            background: 'linear-gradient(45deg, #56ccf2, #2f80ed)',
            color: '#fff',
            padding: '12px 24px',
            borderRadius: '50px',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: 'bold',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
            transition: 'transform 0.3s, box-shadow 0.3s',
          }}
          onMouseEnter={(e) => (e.target.style.transform = 'scale(1.1)')}
          onMouseLeave={(e) => (e.target.style.transform = 'scale(1)')}
        >
          View CV
        </a>
      </div>

      {/* Diagonal Divider */}
      <div
        style={{
          position: 'absolute',
          bottom: '0',
          width: '100%',
          height: '100px',
          background: 'linear-gradient(45deg, #1e1e1e, #000)',
          clipPath: 'polygon(0 0, 100% 50%, 0 100%)',
        }}
      ></div>

      <Footer />
    </div>
  );
};

export default HomePage;
